description:
O Resumo Fotográfico, em parceria com a Irmãs França Fotografia, realizará no dia 28 de maio de 2017, no Rio de Janeiro, a segunda edição do workshop "Foto Retrô - De volta ao universo Pin-up", ministrado pelo fotógrafo e programador visual Cid Costa Neto.

O curso tem como objetivo proporcionar ao participante uma introdução ao universo da fotografia Pin-up, apresentando referenciais teóricos, conceitos de criação, equipamentos e técnicas de iluminação em estúdio e pós-produção digital.

Todo esse conteúdo será colocado em prática pelos participantes com uma modelo durante ensaio no estúdio do fotógrafo. As inscrições podem ser feitas até o dia 21 de maio.

Conteúdo
- História e referências do universo Pin-up;
- Caracterização e criação da personagem;
- Técnicas e esquemas de iluminação em estúdio;
- Estética visual (poses, "Efeito Ops!", etc);
- Pós-processamento (edição, manipulação e integração entre desenho e fotografia).

Vagas: 6
Pré-requisitos: Câmera DSLR (conhecimentos básicos em fotografia)
